import React from "react";
import "./app-header.css"
const AppHeader = () =>{

    return(
        <div>
            <div className="col-sm">
                <h1>My Todo List</h1>
            </div>

            <div className="col-sm">
                1 more to do, 3 done
            </div>

        </div>


    )
}

export default AppHeader;
